const container = document.getElementById("product-container"); // Change to your actual container ID

products.forEach(product => {
  const card = document.createElement("div");
  card.className = "card p-3 m-2";

  const title = document.createElement("h3");
  title.textContent = product.name;
  card.appendChild(title);

  const desc = document.createElement("p");
  desc.textContent = product.desc;
  card.appendChild(desc);

  // Download Link
  if (product.doc) {
    const downloadBtn = document.createElement("a");
    downloadBtn.href = product.doc;
    downloadBtn.textContent = "Download Specs";
    downloadBtn.className = "btn btn-outline-light mt-2";
    downloadBtn.setAttribute("download", "");
    card.appendChild(downloadBtn);
  }

  container.appendChild(card);
});

let currentPage = 1;
const pageSize = 8;

function renderProducts(filtered=products) {
const grid = document.getElementById('productGrid');
grid.innerHTML = '';
const start = (currentPage-1)*pageSize;
const pageItems = filtered.slice(start, start+pageSize);

pageItems.forEach((p, idx) => {
grid.innerHTML += `
<div class="col-6 col-sm-6 col-md-4 col-lg-3 mb-4 fade-in" style="animation-delay:${idx*50}ms">
<div class="card h-100 position-relative">
${p.badge ? `<span class="badge bg-danger card-badge">${p.badge}</span>` : ''}
<img src="${p.img}" class="card-img-top" alt="${p.name}">
<div class="card-body">
<h5 class="product-title">${p.name}</h5>
<p class="card-text">$${p.price}  High-quality storage device.</p>
<button class="cta-btn2 w-100 mt-auto" onclick="showModal(${p.id})">View Details</button>
</div>
</div>
</div>`;
});
renderPagination(filtered.length);
}

function renderPagination(total) {
const pages = Math.ceil(total/pageSize);
const pag = document.getElementById('pagination');
pag.innerHTML = '';
for (let i=1; i<=pages; i++) {
pag.innerHTML += `
<li class="page-item ${i===currentPage?'active':''}">
<a class="page-link" href="#" onclick="goToPage(${i})">${i}</a></li>`;
}
}

function goToPage(p) {
currentPage=p;
filterProducts();
}

function filterProducts() {
const text = document.getElementById('searchBox').value.toLowerCase();
const cat = document.getElementById('categoryFilter').value;
const sort = document.getElementById('sortFilter').value;
let filtered = products.filter(p =>
p.name.toLowerCase().includes(text) &&
(cat==='' || p.brand===cat));

if(sort==='low') filtered.sort((a,b)=>a.price-b.price);
if(sort==='high') filtered.sort((a,b)=>b.price-a.price);

renderProducts(filtered);
}

function showModal(id) {
const p = products.find(x=>x.id===id);
document.getElementById('modalTitle').innerText = p.name;
document.getElementById('modalBody').innerHTML = `
<img src="${p.img}" class="img-fluid mb-3">
<p>${p.desc}</p>
<p>Price: <strong>$${p.price}</strong></p> 
<a href="${p.doc}" download class="cta-btn2 me-2">Download Specs</a>
<button class="cta-btn2">Buy Now</button>`;
new bootstrap.Modal(document.getElementById('productModal')).show();
}

filterProducts();

document.addEventListener("DOMContentLoaded", () => {
  const urlParams = new URLSearchParams(window.location.search);
  const brand = urlParams.get('brand');
  if (brand) {
    const select = document.getElementById('categoryFilter');
    if (select) {
      select.value = brand;
    }
  }
  filterProducts();
});